class LocalazyRequestProcessor {
  MAX_REQUESTS_PER_SECOND = 10;
  MAX_REQUESTS_PER_MINUTE = 100;
  requests = [];
  processing = false;
  requestsInLastSecond = 0;
  requestsInLastMinute = 0;
  lastSecondTimestamp = Date.now();
  lastMinuteTimestamp = Date.now();
  async addRequest(request) {
    return new Promise((resolve, reject) => {
      this.requests.push(async () => {
        try {
          const response = await request();
          resolve(response);
        } catch (error) {
          reject(error);
        }
      });
      this.processRequests();
    });
  }
  async processRequests() {
    if (this.processing) {
      return;
    }
    this.processing = true;
    while (this.requests.length > 0) {
      await sleep(50);
      const currentRequest = this.requests[0];
      if (!currentRequest) {
        break;
      }
      const currentTime = Date.now();
      const elapsedSeconds = Math.floor((currentTime - this.lastSecondTimestamp) / 1e3);
      const ellapsedMinutes = Math.floor((currentTime - this.lastMinuteTimestamp) / 1e3 / 60);
      if (elapsedSeconds >= 1) {
        this.requestsInLastSecond = 0;
        this.lastSecondTimestamp = currentTime;
      }
      if (ellapsedMinutes >= 1) {
        this.requestsInLastMinute = 0;
        this.lastMinuteTimestamp = currentTime;
      }
      if (this.requestsInLastSecond < this.MAX_REQUESTS_PER_SECOND && this.requestsInLastMinute < this.MAX_REQUESTS_PER_MINUTE) {
        const resolveFn = this.createResolveFunction();
        const rejectFn = this.createRejectFunction();
        try {
          const response = await currentRequest();
          this.requests.shift();
          this.requestsInLastSecond += 1;
          this.requestsInLastMinute += 1;
          resolveFn(response);
        } catch (error) {
          rejectFn(error);
        }
      } else {
        break;
      }
    }
    this.processing = false;
    if (this.requests.length > 0) {
      this.processRequests();
    }
  }
  createResolveFunction() {
    let resolveFn;
    const promise = new Promise((resolve) => {
      resolveFn = resolve;
    });
    promise.catch(() => {
    });
    return resolveFn;
  }
  createRejectFunction() {
    let rejectFn;
    const promise = new Promise((_, reject) => {
      rejectFn = reject;
    });
    promise.catch(() => {
    });
    return rejectFn;
  }
}
